  [],\n\t\"revision_timestamp\": \"2016-07-15T04:24:57.085122\",\n\t\"name\": \"chronic-conditions-among-medicare-beneficiaries-03967\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The data used in the chronic condition
  reports are based upon CMS administrative enrollment and claims data for Medicare
  beneficiaries enrolled in the fee-for-service program. These data are available
  from the CMS Chronic Condition Data Warehouse (CCW), a database with 100 percent
  of Medicare enrollment and fee-for-service claims data. The Medicare beneficiary
  population is limited to fee-for-service beneficiaries. We excluded Medicare beneficiaries
  with any Medicare Advantage enrollment during the year since claims data are not
  available for these beneficiaries. Also, we excluded beneficiaries who were enrolled
  at any time in the year in Part A only or Part B only, since their utilization and
  spending cannot be compared directly to beneficiaries enrolled in both Part A and
  Part B. Beneficiaries who died during the year are included up to their date of
  death if they meet the other inclusion criteria.</p>n\",\n\t\"license_title\": \"Other
